    bottom: 0,
    width: "100%",
    height: "75%",
    backgroundColor: "#000"
  },

  container: {
    flex: 1,
    backgroundColor: "#32323275",
    borderTopLeftRadius: 10,
    borderTopRightRadius: 10
  },

  container_traco:{
    width: "100%",
    heigt: "5%",
    justifyContent: "center",
    alignItems: "center"
  },

  traco:{
    fontSize: 40,
    color: "#0CBECE"
  },

  container_valor_mm:{
    height: "5%",
    backgroundColor: "#FFF"
  },

  container_nome:{
    height: "10%",
