  },

  container_img:{
    margin: 2,
    height: "100%",
    width: "20%",
    justifyContent: "center",
    alignItems: "center"

  },

  imagem:{
    height: 50,
    width: 50,
    borderRadius: 9999,
  },



   })
export default styles
